import React, { Component } from "react";
import '../css/App.css'
import '../css/clipart1087676.png'

export default class Header extends Component
{
    render()
    {
        return(
            <div className="header_main_container">
                <img src={require("../css/bottle2.png")} className="logo"/>
                <div className="gender_links">
                    <div className="indiv_link">For Men</div>
                    <div className="indiv_link">For Women</div>
                    <div className="indiv_link">For All</div>
                </div>
                <div className="feature_holder"></div>
            </div>

        )

    }
}
